To elaborate:

```diff
-#settings_page .icon-button.primary {
-    background-color: hsl(156, 30%, 50%);
+#settings_page .icon-button.primary .icon-button-icon {
+    font-weight: lighter;
     color: hsl(0, 0%, 100%);
-    border: 1px solid hsl(155, 30%, 50%);
+}
