```

seems to suggest you've erroneously added the color: hsl(0, 0%, 100%); to .icon-button-icon.... but actually we also have:

```diff
-#settings_page .icon-button.primary .icon-button-icon {
-    font-weight: lighter;
-    color: hsl(0, 0%, 100%);
-}
-
```

Which means it already had `color: hsl(0, 0%, 100%)` and you just moved it and it landed on a line with `color: hsl(0, 0%, 100%)` and this made the commit diff a little confusing. I think you can just add a small bit of text explaining that "we are indeed, only moving things around, even though the diff is a little funny" to your commit message and you should be good.

Atleast... that's as far as I understand?

